import React from "react";
import { LocationProvider } from "./components/LocationContext";
import Analystics from "./components/Analystics";
import Map from "./components/map"; 

function App() {
  return (
    <div>
      <div style={{
        display: "flex", 
        alignItems: "center",
        justifyContent: "space-between", 
        backgroundColor: "#f9f9f9",
        border: "2px solid #b3e5fc",
        borderRadius: "10px",
        padding: "10px",
        textAlign: "center",
        boxShadow: "2px 2px 5px rgba(0,0,0,0.1)",
        margin: "15px auto",  // Center horizontally while reducing space
        width: "100%",  // Make it take up more width
        maxWidth: "1450px"  // Limit maximum width for responsiveness
      }}>
        {/* <h1 style={{ fontSize: "24px", fontWeight: "bold" }}>
          Herzlich Willkommen zu neuen Wegen der Versorgung durch Analyse von Patientenströmen!
        </h1> */}

        {/* Left Logo */}
      <img src="C:/Users/aidah/ng-project/frontend/public/Images/UNIS-f5.jpg" alt="UNIS-f5" style={{ height: "50px", width: "auto" }} />

      {/* Title */}
      <h1 style={{ fontSize: "24px", fontWeight: "bold", margin: "0", flexGrow: 1, textAlign: "center" }}>
          Herzlich Willkommen zu neuen Wegen der Versorgung durch Analyse von Patientenströmen!
      </h1>

      {/* Right Logo */}
      <img src="C:/Users/aidah/ng-project/frontend/public/Images/UNIS.jpg" alt="UNIS" style={{ height: "100px", width: "auto" }} />
  </div>

      <LocationProvider>
        <Map />
        <Analystics />
      </LocationProvider>
    </div>
  );
}


export default App;
